import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'
import UserService from '../services/UserService'

const Login = ({setUser}) => {

  const navigate = useNavigate();

  const [loginInfo, setloginInfo] = useState({
    email:"",
    password:""
  });

  const handleInfo = (e)=>{
    const value = e.target.value;
    setloginInfo({...loginInfo, [e.target.name]:value});
  }

  const handleLogin = (e)=>{
     e.preventDefault();
     UserService.loginUser(loginInfo)
     .then((response) =>{
      console.log(response);
      navigate("/homePage");
     })
     .catch((error) =>{
      console.log("Shubhan Error"+error);
     });
  };

  return (
    <div>
         <div className="nav">
        <h1>Login</h1>
      </div>
      <div className="container">
        <div className="signUp">
            <h2>Sign Up</h2>
            <form>
            <input  id='email' 
                type="email" 
                name="email" 
                value={loginInfo.email}
                onChange={(e) => handleInfo(e)}
                placeholder="Enter email" 
                required
                />
            <br />
            <input
             id='password' 
             type="password" 
             name="password" 
             value={loginInfo.password}
             onChange={(e) => handleInfo(e)}
             placeholder=" Password" 
             required
             />
            <br />
            <button onClick={handleLogin} id='loginButton'>Login</button>
            </form>
            <div className="bottomForm">
          <span>New User ? </span>
          <a  onClick={e => navigate("/signUp")} id='signupLink' className='alreadySingInUp' href="signUp">Sign Up</a>
          </div>
            </div>
            <div className="img">
          <img src='\images\SignUp.jpg' alt="sign up image" />
        </div>
      </div>

    </div>
  )
}

export default Login
